import Header from "../components/Header.js";

export default function App() {
  return (
    <>
      <Head>
        <title>Test Fulogy</title>
        {/* <link rel="icon" href="/favicon.ico" /> */}
      </Head>
      <main className="Main">
        <h1 className="Hidden">Форма</h1>
        <section className="Main-Content">
          <div className="back"></div>
          <Header />
          <h2>Личный </h2>
          <Form />
        </section>
      </main>

